def DefineType(s):
	s = s.lower().strip()
	return DEFINE_TYPES[s] if s in DEFINE_TYPES else ''

def Alias(s):
	sx = s.lower().strip()
	return ALIAS[sx] if sx in ALIAS else s
def is_keyword(s):
	s = Alias(s).lower().strip()
	return KEYWORD[s] if s in KEYWORD else ''



Keyword = is_keyword



pixels_per_row = 26
pixels_per_col = 7

def set_pixels(row,col):
	global pixels_per_row,pixels_per_col
	pixels_per_row = row
	pixels_per_col = col
	
	
	
def htp(x,dontconv=0):
	try:
		f = float(x)
	except:
		return None
	if dontconv: return f
	return pixels_per_row * f
	
def wtp(x,dontconv=0):
	try:
		f = float(x)
	except:
		return None
	if dontconv: return f
	return pixels_per_col * f

def ctp(x,dontconv=0):
	try:
		f = float(x)
	except:
		return None
	if dontconv: return f
	return pixels_per_col * ( f - 1)

def rtp(x,dontconv=0):
	try:
		f = float(x)
	except:
		return None
	if dontconv: return f
	return pixels_per_row * ( f - 1)


def is_string(s):
	return s.startswith('"') or s.startswith("'")
	
	
def nice_string(s):
	for a in ["'",'"']:
		if not s.startswith(a): continue
		return s[1:s.rfind(a)]
